import { BrowserRouter, Routes, Route } from 'react-router-dom';

// Context Provider
import { CBOContextProvider } from './context/CBOcontext';

// Pages & Components
import Home from './pages/Home';
import NavBar from './components/NavBar';

function App() {
  return (
    <CBOContextProvider>
      <BrowserRouter>
        <div className="App">
          <NavBar /> {/* Navbar remains outside Routes for global access */}
          <div className="pages">
            <Routes>
              <Route path="/" element={<Home />} />
            </Routes>
          </div>
        </div>
      </BrowserRouter>
    </CBOContextProvider>
  );
}

export default App;
